1. Wohngebäude, die nach ihrer Art nur für die Benutzung während eines begrenzten Zeitraumes je
Kalenderjahr  bestimmt  sind  und  deren  voraussichtlicher  Energiebedarf  wegen  dieser
eingeschränkten  Nutzungszeit  unter  einem  Viertel  des  Energiebedarfs  bei  ganzjähriger
Benutzung liegt;
2. provisorische Gebäude mit einer Nutzungsdauer bis einschließlich zwei Jahren;
3. Gebäude mit einer Netto-Grundfläche von weniger als 50 m²;
4. land- und forstwirtschaftliche Wirtschaftsgebäude;

