5. Sport- und Freizeitanlagen;
6. Gebäude, die für Gottesdienst und religiöse Zwecke genutzt werden;
7. Baudenkmäler und Gebäude, die als Teil eines ausgewiesenen Umfelds oder auf Grund ihres
besonderen architektonischen oder historischen Werts offiziell geschützt sind;

mehrere Gebäude erstrecken, gelten folgende Mindestanforderungen:
1. bei Wohnhausanlagen ist pro Wohnung mindestens eine Garage oder ein PKW-Abstellplatz
vorzusehen;
ab zehn PKW-Abstellplätzen ist für je 50 angefangene PKW-Abstellplätze (unter Einrechnung
der Garagen) mindestens ein PKW-Abstellplatz für Personen mit Behinderungen vorzusehen;
2. bei Wohnhausanlagen ab neun Wohnungen sind entsprechende Freiflächen für Erholungs- und
Spielzwecke vorzusehen;

(1) Durch diese Verordnung werden folgende Richtlinien der Europäischen Union umgesetzt:
1. Richtlinie 2002/91/EG über die Gesamtenergieeffizienz von Gebäuden, ABl. Nr. L 001 vom
16.12.2002 S. 65;
2. Richtlinie 2010/31/EU über die Gesamtenergieeffizienz von Gebäuden, ABl. Nr. L 153 vom
18.06.2010 S. 13;
3. Richtlinie 2014/61/EU über Maßnahmen zur Reduzierung der Kosten des Ausbaus von
Hochgeschwindigkeitsnetzen  für  die  elektronische  Kommunikation,  ABl.  Nr. L 155  vom
23.05.2014 S. 1;

